import React from 'react'
import Person from './Person'
import RemovePerson from './RemovePerson';

const Persons = ({ persons, removePerson }) => {
  return (
    <div>
      {persons.map(person =>
        <Person 
        key={person.name} 
        name={person.name} 
        number={person.number} 

        />)}
    </div>
  )
};

export default Persons;
